const getCityDataFromServer = (handleSuccess) => {
    fetch("https://storage.googleapis.com/realtour/cities-rt.json", {
            method: 'GET',
        }
    ).then(response => response.json()
    ).then(success => handleSuccess(success)
    ).catch(error => console.log(error))

};

const getApartmentDataFromServer = (handleSuccess) => {
    fetch("https://storage.googleapis.com/realtour/apartments-rt.json", {
            method: 'GET',
        }
    ).then(response => response.json()
    ).then(success => handleSuccess(success)
    ).catch(error => console.log(error))
};

const getAllDataFromServer = (handleSuccess) => {
    fetch("https://storage.googleapis.com/realtour/data-rt.json", {
            method: 'GET',
        }
    ).then(response => response.json()
    ).then(success => {
            handleSuccess(success)
        }
    ).catch(error => console.log(error))

};
export {getAllDataFromServer, getApartmentDataFromServer, getCityDataFromServer};
